import "../App.css"
import Button from '@mui/material/Button';
import { BrowserRouter, Route, Link } from "react-router-dom";

export default function Project(props) {
    console.log('porjects', props)

    return(

            <div class="Product"> 
                <h4>{props.name}</h4>
                <img src={props.image}/>
                {props.desc}
                <a target="_blank" href={process.env.PUBLIC_URL + props.link}>More</a>
                <button target="_blank" href={process.env.PUBLIC_URL + props.link} style={{
"backgroundColor":" #f8f9fa",
"border":" 1px solid #3c4043",
"borderRadius":" 4px",
"color":" #3c4043",
"cursor":" pointer",
"fontSize":" 14px",
"height":" 36px",
"lineHeight":" 27px",
"padding":" 0 16px"
                }} role="button">Button 16</button>

            </div> 


    )
}
